import React from 'react'
import styled from 'styled-components'

const topbar = () => {
  return (
    <Wrapper className='container-fluid' >
        <Options className='py-2 px-4 fw-bold text-secondary montserrat d-flex align-items-center' >
        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="grey" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather px- feather-arrow-left"><line x1="19" y1="12" x2="5" y2="12"></line><polyline points="12 19 5 12 12 5"></polyline></svg>
            Back
        </Options>
    </Wrapper>
  )
}

export default topbar

const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const Options = styled.div`

`
